		`,roles:["3D Modelling","3D Animation","Compositing"],types:["University Project","Individual Project"],created:"July 2021",tools:["Autodesk Maya","Adobe After Effects"],headerImages:["1.jpg","2.jpg","3.jpg"],trailerTitle:"Watch the Breakdown",features:[{media:"pictures/4.jpg",description:`
